import React from "react";
import "./Portrait.css";

class Portrait extends React.Component{
    render(){
        return (
           <div className="Port">
             <div className="Port-head">
                 Here is the head!
             </div>
			 <div className="Port-image">
             </div>
           </div>,

           <div className="Port" style={{position:absolute,
  top: 140,
  height: 640,
  width: 43,
  left: 17}}>
             <div className="Port-head">
                 Here is the head!
             </div>
			 <div className="Port-image">
             </div>
           </div>
       );
    }   
}

export default Portrait;
